class Solution:
    def maxOperations(self, s: str) -> int:
        one_count = [0 for _ in range(len(s))]
        one_count[0] = 1 if s[0] == '1' else 0
        for i in range(1, len(s)):
            one_count[i] = one_count[i - 1] + (1 if s[i] == '1' else 0)
        res = 0
        for i in range(1, len(s)):
            if s[i] == '0' and s[i - 1] == '1':
                res += one_count[i]
        return res
